      </div>
      <div className="rightSide">
        <div>about us</div>
        <div>my order</div>
        <div>my account</div>
        <div>help</div>
      </div>

      <div> &copy; 2021 pedrotechpizza.com</div>  
    </div>
  );
}

export default Footer;
